{"query":"
  query AccountEarnings($id: ID!, $ignoredVaults: [String!]) {
    account(id: $id) {
      vaultPositions(where: { vault_not_in: $ignoredVaults } ) {
        balanceShares
        token {
          id
          decimals
        }
        shareToken {
          symbol
        }
        updates {
          deposits
          withdrawals
          tokensReceived
          tokensSent
        }
        vault {
          id
          latestUpdate {
            pricePerShare
          }
        }
      }
    }
  }
